import React from "react";

import {Navbar,Nav,Container} from 'react-bootstrap';
import "./SearchStyles.css"

const Header= props=>{
 
    return(
      <>
      
      <Navbar collapseOnSelect expand="lg"  variant="dark" className="Navbar">
        <Container>
          <Navbar.Brand id="Brand">Football Leauge Managment</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#Home" id="Home">Home</Nav.Link>
              <Nav.Link href="#Teams" id="Teams">Teams</Nav.Link>
              <Nav.Link href="#Venues" id="Venues">Venues</Nav.Link>
              <Nav.Link href="#Refrees" id="Refrees">Refrees</Nav.Link>
            </Nav>
            <Nav>
              <Nav.Link eventKey={2} href="#logout">Logout</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    
      </>
    );
};
export default Header;
